// src/Pages/HomePage.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/HomePage.css';
import MAVJLogo from '../components/MAVJLogo';

const HomePage = () => {
  const navigate = useNavigate();
  const [price, setPrice] = useState('3000');
  const [stripeLink, setStripeLink] = useState('https://book.stripe.com/cN2eX4gBJ7oPfQY000');

  const handleAccommodationChange = (e) => {
    const selectedOption = e.target.options[e.target.selectedIndex];
    setPrice(selectedOption.value);
    setStripeLink(selectedOption.getAttribute('data-stripe-link'));
  };

  const featureBoxes = [
    { title: 'Sea Moss', image: '/images/SeaMossBanner.jpg', path: '/seamoss' },
    { title: 'Castor Oil', image: '/images/CastorOil.jpg', path: '/oils' },
    { title: 'J2E 7-Day', image: '/images/J2EPod.jpg', path: '/j2e' },
    { title: 'Biochemistry Cards', image: '/images/Atom.jpg', path: '/science' },
    { title: 'Glossary', image: '/images/DNA.jpg', path: '/science' },
    { title: 'Body Map', image: '/images/BodyMap.jpg', path: '/science' }
  ];

  return (
    <div className="homepage bg-black text-gold min-h-screen">
      {/* Hero Title Container */}
      <div className="w-full multicolor-border p-4 mb-4 bg-black">
        <h1 className="text-4xl font-bold text-center">ðŸ’¦MAVJHomeðŸ’¦</h1>
      </div>

      {/* Logo Container Only */}
      <div className="w-full multicolor-border p-6 flex justify-center items-center bg-black mb-4">
        <MAVJLogo />
      </div>

      {/* Paragraph Container */}
      <div className="w-full multicolor-border p-6 bg-black mb-4">
        <p className="text-lg text-center">
          We are a movement guided by frequency, natural rhythms, and ancestral memory. Our mission is to restore balance and vitality through vibrationally harvested Sea Moss, sacred Castor Oils, and the immersive Human Frequency Transformation experience in St. Lucia.
        </p>
      </div>

      {/* Accommodations Section with Title and Unified Border */}
      <section className="w-full multicolor-border p-6 bg-black mb-4">
        <h2 className="text-2xl font-bold mb-2 text-center">ðŸ’¦ðŸŒ´Journey 2 EnlightenmentðŸŒ´ðŸ’¦</h2>
        <form className="text-center">
          <label className="block mb-2 text-lg">Choose Your Accommodations - St. Lucia 7 Days ALL INCLUSIVE:</label>
          <select onChange={handleAccommodationChange} className="mb-4 text-black">
            <option value="3000" data-stripe-link="https://book.stripe.com/cN2eX4gBJ7oPfQY000">Four Man Tent/p - $3000</option>
            <option value="3200" data-stripe-link="https://book.stripe.com/dR6eX4gBJ9wXeMU7su">Two Man Tent/p - $3200</option>
            <option value="3350" data-stripe-link="https://book.stripe.com/aEU8yG1GP4cD0W4aEH">One Man Tent/p - $3350</option>
            <option value="3500" data-stripe-link="https://book.stripe.com/00g6qyadlbF5cEMaEI">Air BnB Style Suite/p - $3500</option>
            <option value="3800" data-stripe-link="https://book.stripe.com/9AQaGObhpbF50W4eUZ">Guest Home/p - $3800</option>
          </select>
          <p className="mb-2 text-lg">Price: ${price}</p>
          <button type="button" onClick={() => window.location.href=stripeLink} className="px-4 py-2 border mr-2">Book Now</button>
          <button type="button" className="px-4 py-2 border">Add to Cart</button>
          <p className="mt-4"><a href="/store" className="underline">Continue Shopping</a></p>
        </form>
      </section>

      {/* Feature Content Boxes 3x2 */}
      <div className="w-full multicolor-border p-6 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4 bg-black mb-4">
        {featureBoxes.map((box, i) => (
          <div
            key={i}
            onClick={() => navigate(box.path)}
            className="cursor-pointer multicolor-border p-4 flex flex-col items-center justify-center hover:shadow-lg hover:scale-105 transition-transform"
          >
            <img src={box.image} alt={box.title} className="w-full h-48 object-cover mb-2" />
            <h3 className="text-xl font-semibold text-center text-gold">{box.title}</h3>
          </div>
        ))}
      </div>

      {/* Photo Gallery Section with Full Width */}
      <section id="photo-gallery" className="w-full multicolor-border p-6 bg-black">
        <h2 className="text-2xl font-bold text-center mb-4">Photo Gallery</h2>
        <div className="gallery grid grid-cols-2 md:grid-cols-4 lg:grid-cols-7 gap-4">
          {["MAVJDigitalLogo.JPG", "DBRoad.jpg", "BigTent.jpeg", "ResTents.jpeg", "GoldSMG.png", "BeachDinner.png", "HorseTour.jpeg"].map((img, i) => (
            <img
              key={i}
              src={`https://raw.githubusercontent.com/MyAlkalineVeganJourney/HF/main/Images/${img}`}
              alt={img.split('.')[0]}
              className="w-full h-auto rounded"
            />
          ))}
        </div>
      </section>
    </div>
  );
};

export default HomePage;
